function RVCupdatesWriteText(text) {
    // Create the main div element
    const mainDiv = document.createElement('div');

    // Split the text by the $ symbol to get paragraphs
    const paragraphs = text.split('$');

    paragraphs.forEach(paragraph => {
        // Trim whitespace from the paragraph
        paragraph = paragraph.trim();
        if (paragraph.length === 0) return;

        // Create the ul element for the paragraph
        const ul = document.createElement('ul');
        ul.classList.add("updatesul")

        // Split the paragraph by newline to process each line
        const lines = paragraph.split('\n');

        lines.forEach(line => {
            line = line.trim();
            if (line.length === 0) return;

            // Check for header
            if (line.startsWith('#')) {
                const h2 = document.createElement('h2');
                h2.textContent = line.substring(1).trim();
                h2.classList.add('updatesh2');
                ul.appendChild(h2);
            } else if (line.startsWith('-')) {
                // Check for list item
                const li = document.createElement('li');
                li.textContent = line.substring(1).trim();
                li.classList.add('updatesli');
                ul.appendChild(li);
            } else {
                    // Handle custom tags
                    if (line === '---') {
                        // Handle <br>
                        const br = document.createElement('br');
                        ul.appendChild(br);
                    } else if (line.startsWith('@@img[') && line.endsWith(']@@')) {
                        // Handle <img>
                        const src = line.slice(6, -3);
                        const img = document.createElement('img');
                        img.src = src;
                        img.width = 150; // Default width, can be modified as needed
                        ul.appendChild(img);
                    } else {
                        // Any other text is considered a normal line, wrapped in a li element
                        const li = document.createElement('li');
                        li.classList.add('updatesli');
                        li.textContent = line;
                        ul.appendChild(li);
                    }
            }
        });

        // Append the ul to the main div
        mainDiv.appendChild(ul);
    });

    return mainDiv;
}

